import React from 'react';
import EventCard from '../components/EventCard/EventCard';
import './EventsPage.css';

export default function EventsPage() {
  // Updated events data with volunteer positions
  const events = [
    {
      id: 1,
      title: "Community Cleanup",
      date: "2023-11-20",
      location: "City Park",
      description: "Help clean up our local park and community spaces.",
      image: "https://images.unsplash.com/photo-1600566752225-555bdd87c640",
      volunteerPositions: [
        "Trash Collector",
        "Recycling Supervisor",
        "Registration Volunteer",
        "Team Leader"
      ]
    },
    {
      id: 2,
      title: "Food Drive",
      date: "2023-12-05",
      location: "Community Center",
      description: "Help collect and distribute food to those in need.",
      image: "https://images.unsplash.com/photo-1507048331197-7d4ac70811cf",
      volunteerPositions: [
        "Food Sorter",
        "Donation Collector",
        "Delivery Driver",
        "Inventory Manager"
      ]
    },
    {
      id: 3,
      title: "Charity Marathon",
      date: "2024-03-15",
      location: "Downtown Area",
      description: "Annual charity run to raise funds for local hospitals.",
      image: "https://images.unsplash.com/photo-1552674605-db6ffd4facb5",
      volunteerPositions: [
        "Water Station",
        "Route Marshal",
        "Registration Desk",
        "First Aid Volunteer"
      ]
    }
  ];

  return (
    <div className="events-page">
      <h1>Upcoming Events</h1>
      <div className="events-grid">
        {events.map(event => (
          <EventCard key={event.id} event={event} />
        ))}
      </div>
    </div>
  );
}
